  true,\n\t\"url\": null,\n\t\"notes\": \"On March 11, 2011, the U.S. Consumer Product
  Safety Commission launched SaferProducts.gov. This site hosts the agency's new Publicly
  Available Consumer Product Safety Information Database. On SaferProducts.gov, consumers
  can submit reports of harm or reports of potential harm. After a short amount of
  time for review by the agency and named manufacturer, these reports go live on SaferProducts.gov
  and are searchable by the public. The public also can export search results. The
  Application Protocol Interface (API), to open the published SaferProducts.gov data
  to developers and businesses so that the information in SaferProducts.gov can be
  accessed by an even greater number of consumers online and on mobile devices.\",\n\t\"license_title\":
